import React from 'react';
import ReactDOM from 'react-dom';
import GlobalStyle from './styles/global';
import Routering from './Routes/routes';

const Login = () => {
  return (
    <React.StrictMode>
      <GlobalStyle/>
      <Routering />
    </React.StrictMode>
  );
}

ReactDOM.render(<Login />, document.getElementById('root'));

export default Login;
